import React from "react";

export const ModelsList = ({models}) => {
    if (models.length) {
        return <p className="center">Моделей пока нет</p>
    }
    return (
        <table className="highlight">
            <thead>
            <tr>
                <th>Название</th>
                <th>Подробнее</th>
            </tr>
            </thead>

            <tbody>
            {models.map(model => {
                return (
                    <tr>
                        <td>Alvin</td>
                        <td>Eclair</td>
                    </tr>
                )
            })}

            </tbody>
        </table>
    )
}
